Systems are created by implementing the System trait. It's a bit involved- but don't worry, there's a helper macro we'll get to down below that makes this much simpler! First, implementing the trait directly. It looks like: Define a system struct CreateEmpty;
impl<'a> System<'a> for CreateEmpty { type Data = (EntitiesMut, &'a mut Empty); fn run((entities, empties): <T::Data as SystemData>::View) { ... }
} First we create a struct, it could be an enum, empty or not it doesn't really matter it's just here to attach the impl on. Note that even if you don't make it empty you won't have access to the struct inside the system. We then choose which storages we want with the Data associated type. We'll see in the next chapters what types can be used in detailed. Finally, we get a tuple as run argument containing views to the storages we asked with Data. You can use <T::Data as SystemData>::View as type, it's a bit esoteric but will work with whatever you borrow. Or you could specify the exact types. Add the workload world.add_workload("Creators", CreateEmpty); Run the workload (which will run its systems) world.run_workload("Creators"); Adding multiple systems to a workload is only a matter of expanding the second argument to a tuple. For example: Define another system - this time using the macro #[system(CreateCount)]
fn run (entities: &mut Entities, counts: &mut Count) { ... } It will also take care of transforming its arguments into tuple(s), no need to worry about it anymore. Add the workload world.add_workload("Creators", (CreateEmpty, CreateCount)); Run the workload world.run_workload("Creators"); This is great because it avoids a ton of boilerplate and provides outer-parallelism without having to do anything. There's a few points to keep in mind about workloads: Workloads will run its systems in parallel where possible. If they can't be run in parallel, then systems run sequentially left-to-right. A workload cannot be modified once its defined. Think of it more as a one-time-setup thing than something you do dynamically at runtime. Workloads are cheap so even if you make a few with similar systems it's ok. Adding a workload with a name that already exists will replace it.
